<script> 
// importing axios for data processes
import axios from "axios"
// importing backend api url 
const BASE_URL = "http://localhost:3000"
export default {
  data() {
    return {
    //objects are api endpoints
      noFiles: true,
      callsettings: {
        precall: "",
      },
      soundsettings: {
        sound: "",
      },
      precall1:
        [
          {
            id: "sample1",
            name: "Church Bell",
            file: new Audio('http://cd.textfiles.com/10000gp2/500SNDS/5_46.WAV'),  //we are defining preview calls  from here as a link
            isPlaying: false
          }],
      precall2:
        [
          {
            id: "sample2",
            name: "Door Bell 1",
            file: new Audio('http://sfxcontent.s3.amazonaws.com/soundfx/DoorBell.mp3'),
            isPlaying: false
          }],
      precall3:
        [
          {
            id: "sample3",
            name: "Door Bell 2",
            file: new Audio('http://www.avid-cutter.de/download/soundfx/doorbell.wav'),
            isPlaying: false
          }],
      precall4:
        [
          {
            id: "sample4",
            name: "Warning Bell",
            file: new Audio('http://cd.textfiles.com/999wavs/WAVS_T/TUERKLIN.WAV'),
            isPlaying: false
          }],
      precall5:
        [
          {
            id: "sample5",
            name: "Alarm Bell",
            file: new Audio('http://www.ufoseries.com/soundEffects/hqAlarmBell.mp3'),
            isPlaying: false
          }],
      precall6:
