          {
            id: "sample7",
            name: "Old Phone",
            file: new Audio('http://soundcavern.free.fr/guitar/Acoustic_Guitar_Chords%20-%20Gmajup.wav'),
            isPlaying: false  //first audio playing status will be false
          }],
      //        precall8:
      //        [
      //        {id: "sample8",
      //         name: "Guitar Chord",
      //         file: new Audio('http://www.mobileer.com/ringtones/me2000/OldPhone_rt.mp3'),
      //         isPlaying: false}
      //        ],
    }
  },
  methods: {
    play(audio) {
      audio.isPlaying = true // we play existing sounds from here
      audio.file.play()
    },
    pause(audio) {
      audio.isPlaying = false // we pause existing sounds from here
      audio.file.pause()
    },
    uploadCall(e) {
      //this.companyLogo = this.$refs.file.files[0] 
      this.noFiles = !e.target.files.length //noFiles is empyt target.file because our add button will be disabled when there is no file in file input(we did like this for don't send null/empty data)
      var files = e.target.files || e.dataTransfer.files
      if (!files.length)
        return
      this.createCall(files[0])
    },
    createCall(file) {
      var reader = new FileReader() 
      var show = this

      reader.onload = (e) => {
        show.precall = e.target.result
      }
      reader.readAsDataURL(file)
    },
    delCall() {
      this.precall = ''
    },
    async sendCall() { // we use this method for audio files that we upload frome device  
      const res = await axios.put(BASE_URL + `/api/callsettings/`, {
        "methods": "PUT",
        id: 1,
        precall: this.precall,
      }).catch(err => { console.log(err) })
      this.callsettings = [...this.callsettings, res.data]
      this.precall = ""
    },
    async sendSelectedCall1() {
      const res = await axios.put(BASE_URL + `/api/callsettings`, {
        "method": "PUT",
        id: 1,
        precall: this.precall,
      }).catch(err => { console.log(err) })
      this.callsettings = [...this.callsettings, res.data] //we send audio files(sounds) as base64 manually for now therefore use different method for different sounds
      this.precall = "data:audio/x-wav;base64,"
    },
    async sendSelectedCall2() {
      const res = await axios.put(BASE_URL + `/api/callsettings`, {
        "method": "PUT",
        id: 1,
        precall: this.precall,
      }).catch(err => { console.log(err) })
      this.callsettings = [...this.callsettings, res.data]
      this.precall = "data:audio/mpeg;base64,"
    },
    async sendSelectedCall3() {
      const res = await axios.put(BASE_URL + `/api/callsettings`, {
        "method": "PUT",
        id: 1,
        precall: this.precall,
      }).catch(err => { console.log(err) })
      this.callsettings = [...this.callsettings, res.data]
      this.precall = "data:audio/wav;base64,"
    },
    async sendSelectedCall4() {
