      }).catch(err => { console.log(err) })
      this.callsettings = [...this.callsettings, res.data]
      this.precall = "data:;base64,"
    },
    async sendSelectedCall6() {
      const res = await axios.put(BASE_URL + `/api/callsettings`, {
