    },
    //     async sendSelectedCall7() {
    //        const res = await axios.post(`http://localhost:3000/api/callsettings`, {
    //          "method": "POST",
    //          precall: this.precall,
    //        })
    //        this.callsettings = [...this.callsettings, res.data]
    //        this.precall = "http://www.mobileer.com/ringtones/me2000/OldPhone_rt.mp3" 
    //     },
    async sendSelectedCall7() {
      const res = await axios.put(BASE_URL + `/api/callsettings`, {
